import actionType from "../Constants/index.js"


export const fetchProducts =(products)=>{
    return {
        type: actionType.fetchProducts,
        payload: products
    }
}
export const increase =()=>{
    return {
        type: actionType.increase,
    }
}
export const decrease =()=>{
    return {
        type: actionType.increase,
    }
}


export const showCart =()=>{
    return {
        type: 'SHOW_CART'
    }
}
